import { Nav } from "react-bootstrap";
import { Link } from "react-router-dom";
import "../App.css";
const NavBar = () => {
  return (
    <Nav className="navBar" variant="pills" defaultActiveKey="/">
      <Nav.Item>
        <Link to="/">HOME </Link>
      </Nav.Item>
      <Nav.Item>
        <Link to="/about" eventKey="link-1">
          ABOUT
        </Link>
      </Nav.Item>
      <Nav.Item>
        <Link to="/porfolio" eventKey="link-2">
          PORTFOLIO
        </Link>
      </Nav.Item>
      <Nav.Item>
        <Link to="/contacts" eventKey="link-3">
          CONTACTS
        </Link>
      </Nav.Item>
    </Nav>
  );
};
export default NavBar;
